import React from 'react'

function Post(props) {
  const { post, deletePost } = props;
  console.log(post.id)
  delPost =() => {
    deletePost(post.id)
  }
  return (
    <>
        <li key={post.id}>
            <h3>{post.title}</h3>
            <p>{post.body}</p>
            <button onClick={delPost}>Delete</button>
        </li>
    </>
  )
}

export default Post
